import React from 'react';

function LabelInput({ label, setLabel }) {
  return (
    <label>
      Label

      <input
        type="text"
        value={label}
        onChange={(e) => setLabel(e.target.value)}
        required
      />
    </label>
  );
}

export default LabelInput;
